import React from 'react'
import Card from '../Card/Card'
import "./FeaturedProducts.scss"

const FeaturedProducts = ({type}) => {

    const data = [
        {
            id:1,
            title:"TITLE",
            img:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shopify.com%2Fblog%2F12206313-the-ultimate-diy-guide-to-beautiful-product-photography&psig=AOvVaw3xMc5rDNEaTmMSz__F9Eiy&ust=1670168667068000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPis9aXl3fsCFQAAAAAdAAAAABAI",
            price:200
        },
        {
            id:2,
            title:"TITLE",
            img:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.red.org%2Freditorial%2Fiphone-14-product-red-iphone-14-plus-product-red&psig=AOvVaw3xMc5rDNEaTmMSz__F9Eiy&ust=1670168667068000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPis9aXl3fsCFQAAAAAdAAAAABAD",
            price:200
        },
        {
            id:3,
            title:"TITLE",
            img:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.red.org%2Freditorial%2Fiphone-14-product-red-iphone-14-plus-product-red&psig=AOvVaw3xMc5rDNEaTmMSz__F9Eiy&ust=1670168667068000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPis9aXl3fsCFQAAAAAdAAAAABAD",
            price:200
        },
        {
            id:4,
            title:"TITLE",
            img:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.red.org%2Freditorial%2Fiphone-14-product-red-iphone-14-plus-product-red&psig=AOvVaw3xMc5rDNEaTmMSz__F9Eiy&ust=1670168667068000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPis9aXl3fsCFQAAAAAdAAAAABAD",
            price:200
        }
    ]

  return (
    <div className='featuredProducts'>
        <div className="top">
            <h1>{type} products</h1>
        </div>
        <div className="bottom">
            {data.map(item=>(
                <Card item={item} key={item.id}/>
            ))}
        </div>
    </div>
  )
}

export default FeaturedProducts
